import uwLogo from '../../resources/color-UWcrest-print.png'

export default class Header extends React.PureComponent{
    render(){
        return(
            <div style={{width: "100%", height: "10%", flex:1 , flexDirection: 'row', textAlign: 'left', display:'flex'}}>
                <img src={uwLogo} style={{height: '100%', width: '6%'}}></img>
                <text style={{fontFamily: 'Helvetica', fontSize: 60, paddingLeft: 20, flex: 1}}>
                    Max Johnson
                </text>
            </div>
        );
    }

    
}
